import React, { Component } from 'react'

class AdminPage extends Component {
	
	render() {
		return (
			<React.Fragment>
                <form class='login-form'>
                    <div class="flex-row">
                        <label class="lf--label" for="username">
                        <svg x="0px" y="0px" width="12px" height="13px">

                        </svg>
                        </label>

                    </div>

                </form>
            </React.Fragment>

		)
	}
}

export default AdminPage;
